import SysPositionModal from "./modules/SysPositionModal";
import { JeecgListMixin } from '@/mixins/JeecgListMixin';
import JDictSelectTag from '@/components/dict/JDictSelectTag';
export default {
  name: 'SysPositionList',
  mixins: [JeecgListMixin],
  components: {
    SysPositionModal: SysPositionModal,
    JDictSelectTag: JDictSelectTag
  },
  data: function data() {
    return {
      description: '职务表管理页面',
      // 表头
      columns: [{
        title: '#',
        dataIndex: '',
        key: 'rowIndex',
        width: 60,
        align: 'center',
        customRender: function customRender(t, r, index) {
          return parseInt(index) + 1;
        }
      }, {
        title: '职务编码',
        align: 'center',
        dataIndex: 'code'
      }, {
        title: '职务名称',
        align: 'center',
        dataIndex: 'name'
      }, {
        title: '职级',
        align: 'center',
        dataIndex: 'postRank_dictText'
      }, // {
      //   title: '公司id',
      //   align: 'center',
      //   dataIndex: 'companyId'
      // },
      {
        title: '操作',
        dataIndex: 'action',
        align: 'center',
        scopedSlots: {
          customRender: 'action'
        }
      }],
      url: {
        list: '/sys/position/list',
        delete: '/sys/position/delete',
        deleteBatch: '/sys/position/deleteBatch',
        exportXlsUrl: '/sys/position/exportXls',
        importExcelUrl: '/sys/position/importExcel'
      }
    };
  },
  computed: {
    importExcelUrl: function importExcelUrl() {
      return "".concat(window._CONFIG['domianURL'], "/").concat(this.url.importExcelUrl);
    }
  }
};
